This layer contains a view of the Crown land Parcels. A parcel is defined as the smallest area of land capable of sale without further approval to subdivide. It may consist of more than one piece. Parcels are described by a parcel description (either lot/plan or allotment/section/parish).

It includes:
- Parcel Identifiers, both freehold and crown;
- Registered and proposed status;
- Crown land differentiation - this is defined as CROWN_STATUS of "C" for Crown land, "V" for Vested land or "G" for Government Roads,
- LGA code;
- Unique Feature Identifiers, date stamps and data quality information.

The layer replaces the "CROWNLAND.VM_CROWNSIMPLE" layer that was created for Mapshare sites as a quick way of drawing Crown land rather than all the Parcels. The Crownsimple layer has had issues with keeping in sync with the Parcel layer, whereas this layer will be re-created each time the Parcel layer is updated (every week).

MetaX records this dataset as VMPROP.PARCEL_CROWN_APPROVED

The On Track Survey has been conducted annually since 2003. School leavers who attended school in the previous year and who agreed to participate in the survey are contacted in April-May to determine their post school destination.
The On Track survey seeks to: 
Offer a consistent and comprehensive approach to monitoring the transistions of school leavers; 
Report the information to schools, local government areas and other education providers and organisations concerned with assisting young people, policy makers, parents and students; 
Provide detailed analyses of the transistions experienced by different groups of leavers; 
Enable education providers to use the findings to monitor and improve their programs; and 
Provide a referral service for school leavers who appear to be experiencing difficulties in the transistion process.

This dataset is an output of the  Pilbara Marine Conservation Partnership (PMCP). Environmental Pessures Theme - Project Habitats and Biodiversity Characterisation and Mapping.  The benthic invertebrate, plant and fish biodiversity of the west Pilbara region was sampled between 10 and 27 June 2013 during voyages on the CSIRO vessel RV Linnaeus and WA Fisheries vessel RV Naturaliste. The equipment used was:
0.75m epibenthic sled at 13 sites for a distance of ~300m or a
1.5m epibenthic sled at 98 sites for a distance of ~150m per tow; 
a Pipe dredge attached to each sled;
an 8 Fathom Florida Flyer Trawl at 43 sites for a distance of ~1km per tow;
and a Drop-Camera video system towed for a 500 m transect at 123 sites to observe and record video of the seabed habitat. Continuous underway coding during Drop-camera transects recorded cover of 9 substratum types, 25 biohabitat types, and occurrence of 14 faunal classes.

The results for the Sled and Trawl are presented as biomass per area swept by the gear (kg per ha).  

During the Voyage Biota collected using the Sled and Trawl were sorted into 26 broad taxonomic categories from each tow (samples). These  were photographed, weighed, preserved and retained for identification.
Large biota such as turtles and seasnakes were measured, counted, weighed (or weight estimated), photographed and returned to the ocean alive.
Non-living rocks/shells were photographed and weighed as a category called trash and returned to the ocean.

The following groups were retained and identified by taxonomists and voucher specimens curated at WA Museum:
Marine Plants;
Sponges;
Corals;
Crustaceans;
Echinoderms;
Molluscs;
and Fishes
 - many sponges were collected and require microscopic examination for identification - processing is expected to be complete mid 2016.

The following groups were retained with no facility for further identification as part of this project, and are currently at CSIRO Oceans and Atmosphere WA:
Ascidians - samples separated into colonial and solitary preserved in formalin;
Brachiopoda - Frozen;
Bryozoa - Frozen;
Hydroids - Frozen;
Miscellaneous - Frozen;
Worms - Formalin.

A pipe-dredge was attached to the sled to collect sediment samples: a 500 ml subsample was retained.

The Pilbara Marine Conservation Partnership (PMCP) was an initiative designed to enhance the net conservation benefits of the globally-significant coral reef ecosystems of the Pilbara (Western Australia) by providing an assessment of the condition and trajectory of key ecological values. These assessments were designed to inform and complement existing governance and management arrangements and the PMCP is intended to provide ongoing advice and assessment for conservation efforts in the region, providing lasting benefits.
The PMCP concept is based on three core ecological components, namely: 
Coral Reef Health - concentrating mainly on habitat forming primary producers.
Fish and Sharks - their community structure, interactions and impacts on lower trophic levels.
Environmental Pressures - physical and anthropogenic factors that influence the condition of reefs

The Bellarine-Corio Bay Local Coastal Hazard Assessment (LCHA) provides information on the extent of coastal hazards and their physical impacts for the Bellarine-Corio Bay coastal environment.

Dynamic inundation modelling was carried out to create this data layer for 1% Annual Exceedance Probability (AEP) coastal inundation under the assumption of 0.8 m Sea Level Rise in 2016, for the following study areas along the coast of the Bellarine Peninsula and Greater Geelong area: Barwon Heads / Lake Connewarre; Breamlea; Newcomb; and Queenscliff / Lakers Cutting.

Details of the assumptions made in the derivation of this information can be found in project reports on the Our Coast website: http://www.ourcoast.org.au/cb_pages/resources.php.
Users of this information should read these project reports to understand the limitations of the data.

